import React from 'react';
import ResumeComponent from './ResumeComponent';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Resume App</h1>
      </header>
      <main>
        <ResumeComponent />
      </main>
    </div>
  );
}

export default App;
